import styled from "@emotion/styled";

export const LoaderWrapper = styled('div')`
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    z-index: 1999;

    .loader_box {
        position: relative;

        @keyframes worm-length {
    0% {
        stroke-dasharray: 19.088;
    }
    10% {
        stroke-dasharray: 30.656;
    }
    20% {
        stroke-dasharray: 19.088;
    }
    30% {
        stroke-dasharray: 30.656;
    }
    40% {
        stroke-dasharray: 19.088;
    }
    50% {
        stroke-dasharray: 30.656;
    }
    60% {
        stroke-dasharray: 19.088;
    }
    70% {
        stroke-dasharray: 30.656;
    }
    80% {
        stroke-dasharray: 19.088;
    }
    90% {
        stroke-dasharray: 30.656;
    }
    100% {
        stroke-dasharray: 19.088;
    }
}

@keyframes worm-move {
    0% {
        stroke-dashoffset: 0;
    }
    25% {
        stroke-dashoffset: -76.352;
    }
    50% {
        stroke-dashoffset: -152.704;
    }
    75% {
        stroke-dashoffset: -229.056;
    }
    100% {
        stroke-dashoffset: -305.408;
    }
}

.pl__worm {
    animation: worm-length 10s linear infinite, worm-move 10s linear infinite;
}

    }
`;
